import React from 'react'
import { EventsData } from '../data/EventsData'

const Events = () => {
  return (
    <div>
      <header id="page-header">
        <div className="page-heading">
          <h2>Events</h2>
        </div>
      </header>

      <div className="page-container">
        div.card
        <div className="row">
          {EventsData.map(item => {
            return (
              <div className='col-md-3'>
                {item.title}
              </div>
            )
          })}

        </div>



      </div>


    </div>
  )
}

export default Events
